import {FC} from 'react';

interface ModalI {
    connectionHandler: (name: string) => void
}

const Modal: FC<ModalI> = ({connectionHandler}) => {

    return (
        <form onSubmit={(e) => e.preventDefault()}>
            <input type="text"/>
            <button onClick={() => connectionHandler}>Connect</button>
        </form>
    )
}

export default Modal;
